import { CLICK_SKILL } from '../actions/types';

const clickSkillReducer = (currentSkill = n, action) => {
  switch(action.type) {
    case CLICK_SKILL:
      return action.payload;
    default:
      return currentSkill;
  }
}

export default clickSkillReducer;
